import React from "react";
import {Link} from 'react-router-dom';
import './Menu.css';


const Menu = (props) => {
    let nav = props.user ?
      <div>
            <Link to='' className='Menu-link'>Dashboard</Link>
            <Link to='' className='Menu-link'>Groups</Link>
            <Link to='' className='Menu-link'>Profile</Link>
            <Link to='' className='Menu-link' onClick={props.handleLogout}>LOG OUT</Link>
      </div>
      :
      <div>
        <Link to='/login' className='Menu-link'>LOG IN</Link>
        <Link to='/signup' className='Menu-link'>SIGN UP</Link>
      </div>;

    return (
      <div className='Menu'>
        {nav}
      </div>
    );
  };
export default Menu;
